(function(){"use strict";importScripts("https://d3js.org/d3-collection.v1.min.js"),importScripts("https://d3js.org/d3-dispatch.v1.min.js"),importScripts("https://d3js.org/d3-quadtree.v1.min.js"),importScripts("https://d3js.org/d3-timer.v1.min.js"),importScripts("https://d3js.org/d3-force.v1.min.js"),onmessage=o=>{const i=o.data.nodes,e=o.data.radius;let s=d3.forceSimulation(i).force("x",d3.forceX().x(t=>t.x)).force("y",d3.forceY().y(t=>t.y)).force("collide",d3.forceCollide().radius(t=>e*4)).stop();for(let t=0,r=Math.ceil(Math.log(s.alphaMin())/Math.log(1-s.alphaDecay()));t<r;++t)s.tick();postMessage({type:"end",nodes:i})}})();
